import React from "react";

import {
  IngridientWrapper,
  IngridientButton,
  IngridientText,
  IngridientCount,
  JustWrapper
} from "./ingridientstyled";

export default function Index({ text, increase, descrease, ...props }) {
  return (
    <IngridientWrapper>
        <IngridientText>{text}</IngridientText>
      <JustWrapper>
        <IngridientButton bg={"red"}> - </IngridientButton>
        <IngridientCount>0</IngridientCount>
        <IngridientButton bg={"lightgreen"}> + </IngridientButton>
      </JustWrapper>
    </IngridientWrapper>
  );
}
